import React from 'react';
import s from './Sidebarfriends.module.css';

const Sidebarfriends = (props) => {
    return (
            <p>
                <div className={s.avatar}>
                    <img src={props.ava}/>
                </div>
                <div>
                    {props.name}
                </div>
            </p>
    )
}

export default Sidebarfriends;
